import { BrowserRouter, Route, Routes, Router } from 'react-router-dom'
import Header from './components/Header.js'
import merch from './pages/merch.js';

function App () {
  return (
    <Router>
    <BrowserRouter>
      <Header />
      <Routes>
        <Route path='/merch' element={<merch />} />

          </Routes>

    </BrowserRouter>
    </Router>
  )
}

export default App
